import HomePage from "./HomePage";

function PageContent(props) {
    console.log(props.active);

    const compo = {};

    switch (props.active) {
        case  "Home":
            compo = HomePage;

        default: 
            compo = div;
    }

    return (
        <div>
            <compo></compo>
        </div>
    );
}

export default PageContent
